    "#Histogram GGplot\n",
    "\n",
    "#Reglar HWY\n",
    "ggplot(mpg_transformed, aes(x = hwy)) +\n",
    "  geom_histogram(binwidth = 2, fill = \"steelblue\", color = \"black\") +\n",
    "  labs(\n",
    "    title = \"Histogram of Highway MPG\",\n",
    "    x = \"Highway MPG\",\n",
    "    y = \"Count\"\n",
    "  )\n",
    "#Ln HWY\n",
    "ggplot(mpg_transformed, aes(x = log_hwy)) + \n",
    "  geom_histogram(binwidth = 0.1, fill = \"darkorange\", color = \"black\") + \n",
    "    labs(\n",
    "        title = \"Histogram of Highway MPG (Transformed)\",\n",
    "        x = \"Highway MPG\",\n",
    "        y = \"Count\"\n",
    "    )"
