   "source": [
    "\n",
    "p1 <- ggplot(mpg_transformed, aes(sample = hwy)) +\n",
    "  stat_qq() +\n",
    "  stat_qq_line() +\n",
    "  labs(title = \"Q–Q Plot of Highway MPG\")\n",
    "\n",
    "p2 <- ggplot(mpg_transformed, aes(sample = log_hwy)) +\n",
    "  stat_qq() +\n",
    "  stat_qq_line() +\n",
    "  labs(title = \"Q–Q Plot of Highway MPG (Transformed)\")\n",
    "\n",
    "# Combine side by side\n",
    "combined <- p1 + p2\n",
    "\n",
    "# Display\n",
    "combined\n",
    "\n",
    "# Save as bigger plot\n",
    "ggsave(\"qqplots_side_by_side.png\", combined, width = 12, height = 6)  # width & height in inches"
   ]
